<h1 class="title">20200325</h1>
<p class="author"><a href="index.html">Takala</a></p>
</header>
<p>本日， 東北大学情報科学研究科を修了し， 修士の学位をゲットした．</p>
<p>卒論に引き続き，ベストプレゼンテーションも受賞することができ， 大変嬉しく思う． 関係各位に謝意を表明し，慢心せず今後の修行生活を送っていきたいと思う．</p>
